var Appc=angular.module("Controllers",[]);Appc.controller("HomeCtrl",["$scope","$http","$location","youtubeService",function(i,e,n,o){i.listVideo={},window.initGapi=function(){o.initService(),i.search("Dogs")},i.changeTextbySearch=function(e){i.listVideo={},o.initService(),i.search(e)},i.search=function(e){o.searchVideo(e,function(e){e.then(function(e){setTimeout(function(){i.$apply(function(){i.listVideo=e.items})},2e3)},function(i){console.log("Failed: "+i)})})}}]);